values  (4, 'Accessory_04', 1500, 55000, 'Something for the every day: this saddle bag features a classic fold-over flap with piped edge detailing throughout. The inside features enough room to house your phone, card holder, and keys, securing with a magnetic snap clasp. Available in khaki and tan faux leather, it is built with a sturdy, woven strap that provides endless comfort when you are on the go, with the tan rendition boasting a chic chevron webbing strap. A customisable style: this bag has a removable strap, meaning you can change up the design...every day of the week! From understated neutrals to punchy prints, why not take a look at our impressive range of bag straps', 'HIDDEN', '2023-10-26 09:02:48.698000 +00:00', null, null, 2, 1, 3, 2, null, null, 0, 1, null, null, null, '{"mediaJsonObjects": [{"mediaKeys": "67ad7c34-0a11-480d-98e8-dcfb5fc4465c", "mediaType": "image/jpeg"}, {"mediaKeys": "87d933dd-e983-410e-9df9-c215503026e2", "mediaType": "image/jpeg"}, {"mediaKeys": "48ece4ed-7f58-4aba-9847-777aa2dd9c21", "mediaType": "image/jpeg"}, {"mediaKeys": "d8e5b7b2-b5de-48db-a8d1-93eb5f11472c", "mediaType": "image/jpeg"}, {"mediaKeys": "31e0b43c-fa0c-45c7-aa36-7820df585c2b", "mediaType": "image/jpeg"}]}', null),
